import React from "react";
import { Typography } from "@material-ui/core";

function ErrorPage() {
	return (
		<div className="error-section">
			<Typography variant="h2">Oops! Looks like there are no districts in the URL!</Typography>
		</div>
	)
}

export default ErrorPage;
